import React, { useState } from 'react';
import './AddAnimal.css';
import axios from 'axios';

function AddAnimal() {
  const [animalName, setAnimalName] = useState('');
  const [animalSpecies, setAnimalSpecies] = useState('');
  const [animalGender, setAnimalGender] = useState('');
  const [animalDoB, setAnimalDoB] = useState('');
  const [animalEndangered, setAnimalEndangered] = useState(false); // Default to false
  const [animalOrigin, setAnimalOrigin] = useState('');
  const [animalLifeStage, setAnimalLifeStage] = useState('');
  const [animalDoA, setAnimalDoA] = useState('');

  // Function to reset form fields
  const handleReset = () => {
    setAnimalName('');
    setAnimalSpecies('');
    setAnimalGender('');
    setAnimalDoB('');
    setAnimalEndangered(false); // Reset to false or a default boolean value
    setAnimalOrigin('');
    setAnimalLifeStage('');
  };

  async function handleSubmit(event) {
    event.preventDefault();

    const currentDate = new Date();
    const formattedDate = `${currentDate.getFullYear()}-${(currentDate.getMonth() + 1).toString().padStart(2, '0')}-${currentDate.getDate().toString().padStart(2, '0')}`;

    const userData = {
      newAnimal: {
        animalName: animalName,
        animalSpecies: animalSpecies,
        animalGender: animalGender,
        animalDoB: animalDoB,
        animalEndangered: animalEndangered, // Already fixed to be a boolean
        animalOrigin: animalOrigin,
        animalLifeStage: animalLifeStage,
        animalDoA: formattedDate
      }
    };

    try {
        const response = await axios.post('http://localhost:5095/api/ZooDb/NewAnimal', userData);
        console.log('Response:', response);
        handleReset();
    } catch (error) {
        console.error('Error data:', error.response?.data);
        if (error.response && error.response.data.errors) {
            console.log('Validation errors:', error.response.data.errors);
        }
    }




  };


  return (
    <div className="add-animal-container">
      <h2>Add Animal</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group-animal">
          <label htmlFor="animalName">Animal Name:</label>
          <input
            type="text"
            id="animalName"
            value={animalName}
            onChange={(e) => setAnimalName(e.target.value)}
            required
          />
        </div>
        <div className="form-group-animal">
          <label htmlFor="animalSpecies">Animal Species:</label>
          <input
            type="text"
            id="animalSpecies"
            value={animalSpecies}
            onChange={(e) => setAnimalSpecies(e.target.value)}
            required
          />
        </div>
        <div className="form-group-animal">
          <label htmlFor="animalGender">Animal Gender:</label>
          <input
            type="text"
            id="animalGender"
            value={animalGender}
            onChange={(e) => setAnimalGender(e.target.value)}
            required
          />
        </div>
        <div className="form-group-animal">
          <label htmlFor="animalDoB">Animal DoB:</label>
          <input
            type="date"
            id="animalDoB"
            value={animalDoB}
            onChange={(e) => setAnimalDoB(e.target.value)}
            required
          />
        </div>
        <div className="form-group-animal">
          <label htmlFor="animalEndangered">Is Animal Endangered?</label>
          <select
            id="animalEndangered"
            value={animalEndangered ? "Yes" : "No"}
            onChange={(e) => setAnimalEndangered(e.target.value === "Yes")} // Ensures it's a boolean
            required
          >
            <option value="No">No</option>
            <option value="Yes">Yes</option>
          </select>

        </div>
        <div className="form-group-animal">
          <label htmlFor="animalOrigin">Animal Origin:</label>
          <input
            type="text"
            id="animalOrigin"
            value={animalOrigin}
            onChange={(e) => setAnimalOrigin(e.target.value)}
            required
          />
        </div>
        <div className="form-group-animal">
          <label htmlFor="animalLifeStage">Animal Life Stage:</label>
          <input
            type="text"
            id="animalLifeStage"
            value={animalLifeStage}
            onChange={(e) => setAnimalLifeStage(e.target.value)}
            required
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default AddAnimal;
